(function(){
  function toggle(ev) {
    var button = ev.target;
    var parent = ev.target.parentElement;
    while(parent) {
      if (parent.tagName === 'TABLE' && parent.classList.contains('summary')) break;
      parent = parent.parentElement;
    }

    if (!parent) return;

    var tbody = parent.querySelector('tbody');
    if (button.classList.contains('opened')) {
      button.classList.remove('opened');
      button.classList.add('closed');
      tbody.style.display = 'none';
    } else {
      button.classList.remove('closed');
      button.classList.add('opened');
      tbody.style.display = 'block';
    }
  }

  var buttons = document.querySelectorAll('.inherited-summary thead .toggle');
  for (var i = 0; i < buttons.length; i++) {
    buttons[i].addEventListener('click', toggle);
  }
})();

// inner link(#foo) can not correctly scroll, because page has fixed header,
// so, I manually scroll.
(function(){
  var matched = location.hash.match(/errorLines=([\d,]+)/);
  if (matched) return;

  function adjust() {
    window.scrollBy(0, -55);
    var el = document.querySelector('.inner-link-active');
    if (el) el.classList.remove('inner-link-active');

    // ``[ ] . ' " @`` are not valid in DOM id. so must escape these.
    var id = location.hash.replace(/([\[\].'"@$])/g, '\\$1');
    var el = document.querySelector(id);
    if (el) el.classList.add('inner-link-active');
  }

  window.addEventListener('hashchange', adjust);

  if (location.hash) {
    setTimeout(adjust, 0);
  }
})();

(function(){
  var els = document.querySelectorAll('[href^="#"]');
  var href = location.href.replace(/#.*$/, ''); // remove existed hash
  for (var i = 0; i < els.length; i++) {
    var el = els[i];
    el.href = href + el.getAttribute('href'); // because el.href is absolute path
  }
})();

(function(){
  var matched = location.pathname.match(/\/(manual\/.*\.html)$/);
  if (!matched) return;

  var currentName = matched[1];
  var cssClass = '.navigation .manual-toc li[data-link="' + currentName + '"]';
  var styleText = cssClass + '{ display: block; }\n';
  styleText += cssClass + '.indent-h1 a { color: #039BE5 }';
  var style = document.createElement('style');
  style.textContent = styleText;
  document.querySelector('head').appendChild(style);
})();

(function(){
  if (location.protocol === 'file:') {
    var elms = document.querySelectorAll('a[href="./"]');
    for (var i = 0; i < elms.length; i++) {
      elms[i].href = './index.html';
    }
  }
})();

(function(){
  prettyPrint();
  var lines = document.querySelectorAll('.prettyprint.linenums li[class^="L"]');
  for (var i = 0; i < lines.length; i++) {
    lines[i].id = 'lineNumber' + (i + 1);
  }

  var matched = location.hash.match(/errorLines=([\d,]+)/);
  if (matched) {
    var lines = matched[1].split(',');
    for (var i = 0; i < lines.length; i++) {
      var id = '#lineNumber' + lines[i];
      var el = document.querySelector(id);
      el.classList.add('error-line');
    }
    return;
  }

  if (location.hash) {
    // ``[ ] . ' " @`` are not valid in DOM id. so must escape these.
    var id = location.hash.replace(/([\[\].'"@$])/g, '\\$1');
    var line = document.querySelector(id);
    if (line) line.classList.add('active');
  }
})();

(function(){
  var searchIndex = window.esdocSearchIndex;
  var searchBox = document.querySelector('.search-box');
  var input = document.querySelector('.search-input');
  var result = document.querySelector('.search-result');
  var selectedIndex = -1;
  var prevText;

  // active search box and focus when mouse enter on search box.
  searchBox.addEventListener('mouseenter', function(){
    searchBox.classList.add('active');
    input.focus();
  });

  // search with text when key is upped.
  input.addEventListener('keyup', function(ev){
    var text = ev.target.value.toLowerCase();
    if (!text) {
      result.style.display = 'none';
      result.innerHTML = '';
      return;
    }

    if (text === prevText) return;
    prevText = text;

    var html = {class: [], method: [], member: [], function: [], variable: [], typedef: [], external: [], file: [], test: [], testFile: []};
    var len = searchIndex.length;
    var kind;
    for (var i = 0; i < len; i++) {
      var pair = searchIndex[i];
      if (pair[0].indexOf(text) !== -1) {
        kind = pair[3];
        html[kind].push('<li><a href="' + pair[1] + '">' + pair[2] + '</a></li>');
      }
    }

    var innerHTML = '';
    for (kind in html) {
      var list = html[kind];
      if (!list.length) continue;
      innerHTML += '<li class="search-separator">' + kind + '</li>\n' + list.join('\n');
    }
    result.innerHTML = innerHTML;
    if (innerHTML) result.style.display = 'block';
    selectedIndex = -1;
  });

  // down, up and enter key are pressed, select search result.
  input.addEventListener('keydown', function(ev){
    if (ev.keyCode === 40) {
      // arrow down
      var current = result.children[selectedIndex];
      var selected = result.children[selectedIndex + 1];
      if (selected && selected.classList.contains('search-separator')) {
        var selected = result.children[selectedIndex + 2];
        selectedIndex++;
      }

      if (selected) {
        if (current) current.classList.remove('selected');
        selectedIndex++;
        selected.classList.add('selected');
      }
    } else if (ev.keyCode === 38) {
      // arrow up
      var current = result.children[selectedIndex];
      var selected = result.children[selectedIndex - 1];
      if (selected && selected.classList.contains('search-separator')) {
        var selected = result.children[selectedIndex - 2];
        selectedIndex--;
      }

      if (selected) {
        if (current) current.classList.remove('selected');
        selectedIndex--;
        selected.classList.add('selected');
      }
    } else if (ev.keyCode === 13) {
      // enter
      var current = result.children[selectedIndex];
      if (current) {
        var link = current.querySelector('a');
        if (link) location.href = link.href;
      }
    } else {
      return;
    }

    ev.preventDefault();
  });

  // select search result when search result is mouse over.
  result.addEventListener('mousemove', function(ev){
    var current = result.children[selectedIndex];
    if (current) current.classList.remove('selected');

    var li = ev.target;
    while (li) {
      if (li.nodeName === 'LI') break;
      li = li.parentElement;
    }

    if (li) {
      selectedIndex = Array.prototype.indexOf.call(result.children, li);
      li.classList.add('selected');
    }
  });

  // clear search result when body is clicked.
  document.body.addEventListener('click', function(ev){
    selectedIndex = -1;
    result.style.display = 'none';
    result.innerHTML = '';
  });

})();

(function(){
  function toggle(ev) {
    var button = ev.target;
    var parent = ev.target.parentElement;
    while(parent) {
      if (parent.tagName === 'TR' && parent.classList.contains('test-interface')) break;
      parent = parent.parentElement;
    }

    if (!parent) return;

    var direction;
    if (button.classList.contains('opened')) {
      button.classList.remove('opened');
      button.classList.add('closed');
      direction = 'closed';
    } else {
      button.classList.remove('closed');
      button.classList.add('opened');
      direction = 'opened';
    }

    var targetDepth = parseInt(parent.dataset.testDepth, 10) + 1;
    var nextElement = parent.nextElementSibling;
    while (nextElement) {
      var depth = parseInt(nextElement.dataset.testDepth, 10);
      if (depth >= targetDepth) {
        if (direction === 'opened') {
          if (depth === targetDepth)  nextElement.style.display = '';
        } else if (direction === 'closed') {
          nextElement.style.display = 'none';
          var innerButton = nextElement.querySelector('.toggle');
          if (innerButton && innerButton.classList.contains('opened')) {
            innerButton.classList.remove('opened');
            innerButton.classList.add('closed');
          }
        }
      } else {
        break;
      }
      nextElement = nextElement.nextElementSibling;
    }
  }

  var buttons = document.querySelectorAll('.test-summary tr.test-interface .toggle');
  for (var i = 0; i < buttons.length; i++) {
    buttons[i].addEventListener('click', toggle);
  }

  var topDescribes = document.querySelectorAll('.test-summary tr[data-test-depth="0"]');
  for (var i = 0; i < topDescribes.length; i++) {
    topDescribes[i].style.display = '';
  }
})();

let {VM} = require('vm2');

/**
 * Collects console output from the VM.
 */
class MyConsole {
  constructor() {
    this.outputs = [];
  }
  log(val) {
    this.outputs.push(val);
  }
}

/**
 * Parses parameters from either a function declaration or function declaration and body.
 * @param {string} functionString The function string to parse.
 * @returns An array of parameters to the function.
 */
function parseParameters(functionString) {
  let params = functionString.match(/\([^\{]*\)/)[0];
  params = params.substr(1, params.length - 2);
  return params.split(/[, ]/);
}

/**
 * Aggregates an array of function strings into a single code string.
 * @param {string[]} functions The array of function strings to combine.
 * @returns A string containing all the given functions.
 */
function aggregate(functions) {
  let code = "";
  functions.forEach(f => code += f.charAt(f.length - 1) === ";" ? f : f + ";");
  return code;
}

/**
 * Runs the code in a VM.
 * @param {string} code A string representation of the code to execute. 
 * @return {string[]} An array containing the outputs from code execution.
 */
function runCode(code) {
  try {
    let myConsole = new MyConsole();
    const vm = new VM({
      timeout: 5000,
      sandbox: {
        console: myConsole
      }
    });

    let result = vm.run(code);
    if (result !== undefined) {
      myConsole.outputs.push(result);
    }

    return myConsole.outputs;
  }
  catch (error) {
    console.log(error.message);
    return [ error.message ];
  }
}

/**
 * Runs code raw (i.e. doesn't parse any functions to execute).
 * @param {string[]} functions An array of function strings and code outside of functions to execute.
 * @return {string[]} An array containing outputs from the code execution.
 */
function runRaw(functions) {
  return runCode(aggregate(functions));
}

/**
 * Parses out a function to run and executes the code
 * @param {string[]} params The parameters supplied by the user to pass to the function.
 * @param {functions[]} functions An array of function strings to execute.
 * @return {string[]} An array containing outputs from the code execution.
 */
function runFunction(params, functions) {
  let paramNames = parseParameters(functions[1]);
  functions[1] = functions[1].substr(functions[1].indexOf("{")+1);
  for (let i = 0; i < paramNames.length && i < params.length; i++) {
    functions[1] = `let ${paramNames[i]} = ${params[i]};` + functions[1];
  }
  functions[1] = `function main() {${functions[1]} main()`;

  return runCode(aggregate(functions));
}

/**
 * Parses a given string of code into functions.
 * @param {string} code A string representation of the code to execute.
 * @return {string[]} An array containing functions and code outside of all functions, represented as a string.
 */
function parseFunctions(code) {
  let functions = [""];
  let inTopLevelFunction = false;
  let braceCounter = 0;
  let mainIndex = 1;

  let lines = code.split(/(?<=[;\n\r\{\}]\s*)/g);

  for (let i = 0; i < lines.length; i++) {
    lines[i] = lines[i].trim();
    if (lines[i].length > 8 && (lines[i].substr(0, 8) === "function") && !inTopLevelFunction && braceCounter == 0) {
      mainIndex = lines[i].length > 13 && lines[i].substr(9, 13) === "main" ? i : mainIndex;

      functions.push(lines[i]);
      inTopLevelFunction = true;
    }
    else if (inTopLevelFunction) {
      functions[functions.length - 1] += lines[i];
    }
    else {
      functions[0] += lines[i];
    }
    braceCounter += (lines[i].match(/\{/g)||[]).length;
    braceCounter -= (lines[i].match(/\}/g)||[]).length;
    inTopLevelFunction = inTopLevelFunction && braceCounter !== 0;
  }

  if (mainIndex > 1) {
    let temp = functions[1];
    functions[1] = functions[mainIndex];
    functions[mainIndex] = temp;
  }
  return functions;
}

/**
 * Executes code with the given parameters.
 * @param {string[]} params The parameters supplied by the user to pass to the code.
 * @param {string} code A string representation of the code to execute.
 * @return {string[]} An array containing the outputs from the code execution.
 */
module.exports = function (params, code) {
  let functions = parseFunctions(code);
  if (functions[0] !== "") {
    return runRaw(functions);
  }
  else {
    return runFunction(params, functions);
  }
}

var express = require('express');
var fs = require('fs');
var path = require('path');
var http = require('http');
var https = require('https');
var forward = require('http-forward');

var executor = require('./executor');

var app = express();
app.use(express.json());

var HTTP_PORT = 3001;

/**
 * Creates the server, listening on HTTP_PORT.
 */
http.createServer(app).listen(HTTP_PORT,function() {
  console.log('Listening HTTP on port ' + HTTP_PORT);
});

/**
 * A status endpoint. If this responds, the server can take requests.
 */
app.get('/', function(req, res) {
  res.sendStatus(200);
})

/**
 * Executes given code. The code and parameters should be passed in a JSON object
 * in the format {"params": [<params?], "code": <code>}
 */
app.post('/', function(req, res) {
  console.log(req.body);
  let params = req.body["params"];
  let code = req.body["code"];
  res.send(executor(params, code));
});
